import styled from "styled-components";
import WaveImage from '../../image/wavered.png';
import WaveButton from "./ButtonStyle";
function Button({ value, className, onClick }) {
    return(
        <WaveButton className={className} onClick={onClick}>
            {value}
        </WaveButton>
    )
}

export default Button;
